import React from "react";
import "../App.css";

export default function Contact() {
  const onclick =()=>{
     <symbol id="info-fill" viewBox="0 0 16 16">
    <path d="M8 16A8 8 0 1 0 8 0a8 8 0 0 0 0 16zm.93-9.412-1 4.705c-.07.34.029.533.304.533.194 0 .487-.07.686-.246l-.088.416c-.287.346-.92.598-1.465.598-.703 0-1.002-.422-.808-1.319l.738-3.468c.064-.293.006-.399-.287-.47l-.451-.081.082-.381 2.29-.287zM8 5.5a1 1 0 1 1 0-2 1 1 0 0 1 0 2z"/>
  </symbol>
  }
  return (
    <div className="contact-container">
      {/* Left Side - Contact Form */}
      <div className="cform">
        <h1>Contact Us</h1>
        <p>Weâ€™d love to hear from you! Fill out the form below.</p>

        <form>
          <input type="text" placeholder="Your Name" required />
          <input type="email" placeholder="Your Email" required />
          <textarea rows="5" placeholder="Your Message" required></textarea>
          <button type="submit" onClick={onclick}>Send Message</button>
        </form>
      </div>

      {/* Right Side - Image */}
      <div className="cimage">
        <img
          src="https://images.unsplash.com/photo-1525182008055-f88b95ff7980?auto=format&fit=crop&w=800&q=80"
          alt="Contact"
        />
      </div>
    </div>
  );
}
